/** @jsx jsx */
import { css, jsx } from '@emotion/core';

export const HomePage = () => (
  <div
    css={css`
      margin: 50px auto 20px auto;
      padding: 30px 20px;
      max-width: 600px;
    `}
  >
    <div
      css={css`
        display: flex;
      `}
    >
      <h2>Unanswered Questions</h2>
      <button>Ask a question</button>
    </div>
  </div>
);
